<!DOCTYPE html>
<html lang="zh-CN">

    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>筛选日志工具</title>
        <style>
            /* 基础样式 */
            body {
                font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
                background-color: #f8fafc;
                color: #334155;
                margin: 0;
                padding: 0;
            }

            .container {
                max-width: 100%;
                padding-left: 1rem;
                padding-right: 1rem;
                margin-left: auto;
                margin-right: auto;
            }

            /* 表格样式 */
            .table-container {
                background-color: #ffffff;
                border-radius: 0.5rem;
                box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
                overflow: hidden;
            }

            .table {
                width: 100%;
                border-collapse: collapse;
            }

            .table th,
            .table td {
                padding: 0.75rem;
                text-align: left;
                border-bottom: 1px solid #e2e8f0;
            }

            .table th {
                background-color: #f1f5f9;
                font-weight: 600;
                text-transform: uppercase;
                font-size: 0.75rem;
                color: #64748b;
            }

            .table tbody tr:hover {
                background-color: #f8fafc;
            }

            .font-bold {
                font-weight: bold;
            }

            .flex {
                display: flex;
            }

            .flex-grow {
                flex-grow: 1;
            }

            .justify-between {
                justify-content: space-between;
            }

            .items-center {
                align-items: center;
            }

            .bg-white {
                background-color: white;
            }

            .shadow-md {
                box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
            }

            .border-t {
                border-top: 1px solid #e2e8f0;
            }

            .ml-2 {
                margin-left: 0.5rem;
            }

            .mr-2 {
                margin-right: 0.5rem;
            }

            .mt-3 {
                margin-top: 0.75rem;
            }

            .mb-3 {
                margin-bottom: 0.75rem;
            }

            .p-4 {
                padding: 1rem;
            }

            .px-3 {
                padding-left: 0.75rem;
                padding-right: 0.75rem;
            }

            .py-3 {
                padding-top: 0.75rem;
                padding-bottom: 0.75rem;
            }

            .px-4 {
                padding-left: 1rem;
                padding-right: 1rem;
            }

            .py-4 {
                padding-top: 1rem;
                padding-bottom: 1rem;
            }

            .px-6 {
                padding-left: 1.5rem;
                padding-right: 1.5rem;
            }

            .py-6 {
                padding-top: 1.5rem;
                padding-bottom: 1.5rem;
            }

            .text-center {
                text-align: center;
            }

            .text-primary {
                color: #165DFF;
            }

            .text-xl {
                font-size: 1.25rem;
            }

            .text-sm {
                font-size: 0.875rem;
            }

            .text-xs {
                font-size: 0.75rem;
            }

            .text-gray-500 {
                color: #6B7280;
            }

            .text-gray-600 {
                color: #4b5563;
            }

            /* 筛选行样式 */
            .filter-row {
                display: none;
            }

            .filter-input {
                width: 90%;
                padding: 0.5rem 0.75rem;
                border: 1px solid #cbd5e1;
                border-radius: 0.375rem;
                font-size: 0.875rem;
            }

            .filter-select {
                width: 110%;
            }

            /* 按钮样式 */
            .btn {
                display: inline-flex;
                align-items: center;
                justify-content: center;
                padding: 0.5rem 1rem;
                border-radius: 0.375rem;
                font-size: 0.875rem;
                cursor: pointer;
                transition: background-color 0.2s;
            }

            .btn-primary {
                background-color: #165DFF;
                color: #ffffff;
                border: 1px solid #165DFF;
            }

            .btn-primary:hover {
                background-color: #0e4bdb;
            }

            .btn-outline {
                background-color: #ffffff;
                color: #334155;
                border: 1px solid #cbd5e1;
            }

            .btn-outline:hover {
                background-color: #f8fafc;
            }

            /* 搜索框样式 */
            .search-container {
                position: relative;
                margin-bottom: 1rem;
            }

            .search-input {
                width: 93%;
                padding: 0.75rem 2.5rem;
                border: 1px solid #cbd5e1;
                border-radius: 0.5rem;
                font-size: 0.875rem;
            }

            .search-icon {
                position: absolute;
                left: 1rem;
                top: 0.75rem;
                color: #94a3b8;
            }

            /* 级别标签样式 */
            .level-tag {
                display: inline-block;
                padding: 0.25rem 0.5rem;
                border-radius: 9999px;
                font-size: 0.75rem;
                font-weight: 500;
            }

            .level-debug {
                background-color: #e9f5db;
                color: #386641;
            }

            .level-info {
                background-color: #e0f2fe;
                color: #0369a1;
            }

            .level-warning {
                background-color: #fff7ed;
                color: #ea580c;
            }

            .level-critical {
                background-color: #fce7f3;
                color: #be123c;
            }

            .level-fatal {
                background-color: #fef2f2;
                color: #991b1b;
                font-weight: bold;
            }

            .fa-solid {
                display: inline-block;
                width: 1rem;
                height: 1.5rem;
                margin-left: 0.0rem;
                transition: all 0.2s ease;
                font-style: normal;
                vertical-align: middle;
            }

            .fa-sort svg {
                width: 100%;
                height: 100%;
                fill: #9ca3af;
                transition: fill 0.2s ease;
            }

            .fa-sort .asc-arrow {
                fill: #9ca3af;
                /* 默认灰色 */
            }

            .fa-sort .desc-arrow {
                fill: #9ca3af;
                /* 默认灰色 */
            }

            .fa-sort-asc .asc-arrow {
                fill: #2563eb;
                /* 升序时上箭头高亮 */
            }

            .fa-sort-asc .desc-arrow {
                fill: #e5e7eb;
                /* 升序时下箭头淡化 */
            }

            .fa-sort-desc .asc-arrow {
                fill: #e5e7eb;
                /* 降序时上箭头淡化 */
            }

            .fa-sort-desc .desc-arrow {
                fill: #dc2626;
                /* 降序时下箭头高亮 */
            }

            .overflow-x-auto {
                overflow-x: auto;
                /* 水平方向内容溢出时显示滚动条 */
                -webkit-overflow-scrolling: touch;
                /* 优化iOS滚动体验 */
                scrollbar-width: thin;
                /* Firefox 滚动条样式 */
                scrollbar-color: rgba(156, 163, 175, 0.5) transparent;
                /* Firefox 滚动条颜色 */
            }

            /* WebKit 浏览器自定义滚动条 */
            .overflow-x-auto::-webkit-scrollbar {
                height: 6px;
                /* 滚动条高度 */
            }

            .overflow-x-auto::-webkit-scrollbar-track {
                background: transparent;
                /* 滚动条轨道背景 */
            }

            .overflow-x-auto::-webkit-scrollbar-thumb {
                background-color: rgba(156, 163, 175, 0.5);
                /* 滚动条滑块颜色 */
                border-radius: 3px;
                /* 滑块圆角 */
            }

            /* 响应式设计 */
            @media (min-width: 640px) {
                .container {
                    max-width: 640px;
                }
            }

            @media (min-width: 768px) {
                .container {
                    max-width: 768px;
                }
            }

            @media (min-width: 1024px) {
                .container {
                    max-width: 1024px;
                }
            }

            @media (min-width: 1280px) {
                .container {
                    max-width: 1280px;
                }
            }

            /* 加载动画 */
            .loader {
                border: 3px solid #f3f3f3;
                border-radius: 50%;
                border-top: 3px solid #165DFF;
                width: 16px;
                height: 16px;
                animation: spin 1s linear infinite;
                display: inline-block;
                margin-right: 0.5rem;
            }

            @keyframes spin {
                0% {
                    transform: rotate(0deg);
                }

                100% {
                    transform: rotate(360deg);
                }
            }

            /* 无数据提示 */
            .no-data {
                text-align: center;
                padding: 2rem;
                color: #94a3b8;
            }

            .hidden {
                display: none;
            }
        </style>
    </head>

    <body>
        <header class="bg-white shadow-md py-4 px-4">
            <div class="container">
                <h1 class="text-xl font-bold text-primary flex items-center">
                    <i class="fa-solid fa-table mr-2"></i>
                    简易日志筛选
                </h1>
            </div>
        </header>

        <main class="flex-grow container py-6">
            <div class="table-container">
                <div class="p-4">
                    <div class="search-container">
                        <i class="fa-solid fa-search search-icon"></i>
                        <input type="text" id="globalSearch" class="search-input" placeholder="全局搜索...">
                    </div>
                </div>

                <div class="overflow-x-auto">
                    <table class="table">
                        <thead>
                            <tr>
                                <th data-column="timestamp" style="width: 18%;">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>时间</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <!-- 这个绘制只有斜边 -->
                                                <!-- <path class="asc-arrow" d="M12 16 l-6-6 1.41-1.41 L12 13.17 l4.59-4.58 L18 10 z" /> -->
                                                <!-- <path class="desc-arrow" d="M12 20 l-6 6 1.41 1.41 L12 22.83 l4.59 4.58 L18 26 z" /> -->
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                                <th data-column="level" style="width: 10%;">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>级别</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                                <th data-column="module" style="width: 10%;">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>模块</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                                <th data-column="threadName" style="width: 10%;">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>线程名称</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                                <th data-column="threadId" style="width: 10%;">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>线程ID</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                                <th data-column="message">
                                    <div
                                        class="flex items-center cursor-pointer hover:bg-gray-100 px-2 py-1 rounded transition-colors">
                                        <span>消息</span>
                                        <i class="fa-solid fa-sort ml-2 text-gray-400">
                                            <svg viewBox="0 0 24 36">
                                                <path class="asc-arrow" d="M12 11 L6 17 L18 17 Z" fill="none" />
                                                <path class="desc-arrow" d="M12 25 L6 19 L18 19 Z" fill="none" />
                                            </svg>
                                        </i>
                                    </div>
                                </th>
                            </tr>
                            <tr id="filterRow" class="filter-row">
                                <td>
                                    <input type="text" class="filter-input" data-column="timestamp">
                                </td>
                                <td>
                                    <select class="filter-input filter-select" data-column="level">
                                        <option value="">全部</option>
                                        <option value="DEBUG">DEBUG</option>
                                        <option value="INFO">INFO</option>
                                        <option value="WARNING">WARNING</option>
                                        <option value="CRITICAL">CRITICAL</option>
                                        <option value="FATAL">FATAL</option>
                                    </select>
                                </td>
                                <td>
                                    <input type="text" class="filter-input" data-column="module">
                                </td>
                                <td>
                                    <input type="text" class="filter-input" data-column="threadName">
                                </td>
                                <td>
                                    <input type="text" class="filter-input" data-column="threadId">
                                </td>
                                <td>
                                    <input type="text" class="filter-input" data-column="message">
                                </td>
                            </tr>
                            <tr id="indicatorRow" class="hidden">
                                <td colspan="6" class="no-data loader"></td>
                            </tr>
                        </thead>
                        <tbody id="tableBody">
                            <!-- 表格数据将通过JavaScript动态填充 -->
                        </tbody>
                    </table>
                </div>

                <div class="p-4 border-t">
                    <div class="flex justify-between items-center">
                        <div class="text-sm text-gray-600">
                            共 <span id="totalCount">0</span> 条数据
                        </div>
                        <div>
                            <button id="clearFiltersBtn" class="btn btn-outline">
                                <i class="fa-solid fa-ban mr-1"></i> 清除筛选
                            </button>
                            <button id="refreshBtn" class="btn btn-primary ml-2">
                                <i class="fa-solid fa-refresh mr-1"></i> 刷新
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </main>

        <footer class="bg-white border-t border-gray-200 py-3 px-3">
            <div class="container text-center text-xs text-gray-500">
                © 2025 简易日志筛选应用
            </div>
        </footer>

        <script>
            document.title = 'log_20250702_165857.html';




            // 全局变量
            let allData = [];
            let filteredData = [...allData];
            let sortField = null;
            let sortDirection = 'asc';

            // DOM 元素
            const tableBody = document.getElementById('tableBody');
            const indicatorRow = document.getElementById('indicatorRow');
            const globalSearch = document.getElementById('globalSearch');
            const filterRow = document.getElementById('filterRow');
            const filterInputs = document.querySelectorAll('.filter-input');
            const totalCount = document.getElementById('totalCount');
            const clearFiltersBtn = document.getElementById('clearFiltersBtn');
            const refreshBtn = document.getElementById('refreshBtn');

            // 工具函数
            const formatDateTime = (isoString) => {
                const date = new Date(isoString);
                let formatted = date.toLocaleString('zh-CN', {
                    year: 'numeric',
                    month: '2-digit',
                    day: '2-digit',
                    hour: '2-digit',
                    minute: '2-digit',
                    second: '2-digit',


                });
                // 获取毫秒部分并补零（确保显示三位数字）
                const milliseconds = date.getMilliseconds().toString().padStart(3, '0');

                // 在秒后面添加毫秒
                return formatted.replace(/(\d{2}:\d{2}:\d{2})/, `$1.${milliseconds}`);
            };

            const getLevelClass = (level) => {
                switch (level) {
                    case 'TRACE':
                        return 'level-trace';
                    case 'DEBUG':
                        return 'level-debug';
                    case 'INFO':
                        return 'level-info';
                    case 'WARNING':
                        return 'level-warning';
                    case 'CRITICAL':
                        return 'level-critical';
                    case 'FATAL':
                        return 'level-fatal';
                    default:
                        return '';
                }
            };

            // 更新表格
            const updateTable = () => {
                tableBody.innerHTML = '';

                if (filteredData.length === 0) {
                    tableBody.innerHTML = `
                    <tr>
                        <td colspan="6" class="no-data">
                            <div>
                                <i class="fa-solid fa-file-text text-gray-300 text-4xl mb-2"></i>
                                <p>没有找到匹配的数据</p>
                            </div>
                        </td>
                    </tr>
                `;
                    totalCount.textContent = '0';
                    indicatorRow.style.display = 'none';

                    return;
                }

                filteredData.forEach(item => {
                    const row = document.createElement('tr');
                    row.className = 'hover:bg-gray-50 transition-colors';

                    row.innerHTML = `
                    <td>${formatDateTime(item.timestamp)}</td>
                    <td><span class="level-tag ${getLevelClass(item.level)}">${item.level}</span></td>
                    <td>${item.module}</td>
                    <td>${item.threadName}</td>
                    <td>${item.threadId}</td>
                    <td>${item.message}</td>
                `;

                    tableBody.appendChild(row);
                });



                totalCount.textContent = filteredData.length;
                indicatorRow.style.display = 'none';
            };

            function toggleSortDirection() {
                const icon = document.querySelector(".fa-sort");
                if (sortDirection === "asc") {
                    icon.className = "fa fa-sort-desc";
                    sortDirection = "desc";
                } else {
                    icon.className = "fa fa-sort-asc";
                    sortDirection = "asc";
                }
            }

            // 应用筛选
            const applyFilters = () => {
                // 从筛选输入框获取筛选条件
                const columnFilters = {};
                filterInputs.forEach(input => {
                    const column = input.getAttribute('data-column');
                    const value = input.value.trim().toLowerCase();

                    if (value) {
                        columnFilters[column] = value;
                    }
                });

                // 应用全局搜索
                const globalSearchValue = globalSearch.value.trim().toLowerCase();

                // 筛选数据
                filteredData = allData.filter(item => {
                    // 检查每列的筛选条件
                    for (const [column, value] of Object.entries(columnFilters)) {
                        if (!item[column].toLowerCase().includes(value)) {
                            return false;
                        }
                    }

                    // 检查全局搜索
                    if (globalSearchValue && !Object.values(item).some(val =>
                        val?.toString().toLowerCase().includes(globalSearchValue)
                    )) {
                        return false;
                    }

                    return true;
                });

                // 应用排序
                if (sortField) {
                    filteredData.sort((a, b) => {
                        if (sortDirection === 'asc') {
                            return a[sortField] > b[sortField] ? 1 : -1;
                        } else {
                            return a[sortField] < b[sortField] ? 1 : -1;
                        }
                    });
                }

                // 更新表格
                updateTable();
            };

            // 清除所有筛选
            const clearAllFilters = () => {
                // 清除列筛选
                filterInputs.forEach(input => {
                    input.value = '';
                });

                // 清除全局搜索
                globalSearch.value = '';

                // 重置筛选状态
                sortField = null;
                sortDirection = 'asc';

                // 重置排序图标
                document.querySelectorAll('th[data-column] i.fa-solid').forEach(icon => {
                    icon.className = 'fa-solid fa-sort ml-2 text-gray-400';
                });

                // 重置过滤行状态
                filterRow.style.display = 'none';

                // 应用筛选
                filteredData = [...allData];
                updateTable();
            };

            // 初始化排序功能
            const initSorting = () => {
                document.querySelectorAll('th[data-column]').forEach(th => {
                    th.addEventListener('click', () => {
                        const column = th.getAttribute('data-column');

                        // 显示筛选行
                        filterRow.style.display = 'table-row';
                        indicatorRow.style.display = 'table-row';

                        // 执行排序
                        if (sortField === column) {
                            sortDirection = sortDirection === 'asc' ? 'desc' : 'asc';
                        } else {
                            sortField = column;
                            sortDirection = 'asc';
                        }

                        // 更新排序图标
                        document.querySelectorAll('th[data-column] i.fa-solid').forEach(icon => {
                            icon.className = 'fa-solid fa-sort ml-2 text-gray-400';
                        });

                        const sortIcon = th.querySelector('i.fa-solid');
                        sortIcon.className = `fa-solid fa-sort-${sortDirection} ml-2`;

                        // 应用排序
                        setTimeout(() => {
                            applyFilters();
                        }, 0);
                    });
                });
            };

            // 初始化事件监听器
            const initEventListeners = () => {
                // 筛选输入框
                filterInputs.forEach(input => {
                    input.addEventListener('input', debounce(applyFilters, 1000));
                });

                // 全局搜索
                globalSearch.addEventListener('input', debounce(applyFilters, 1000));

                // 清除所有筛选
                clearFiltersBtn.addEventListener('click', clearAllFilters);

                // 刷新按钮
                refreshBtn.addEventListener('click', () => {
                    // 显示加载动画
                    refreshBtn.innerHTML = '<span class="loader"></span>刷新中...';
                    refreshBtn.disabled = true;

                    // 模拟刷新
                    setTimeout(() => {
                        clearAllFilters();

                        // 恢复按钮状态
                        refreshBtn.innerHTML = '<i class="fa-solid fa-refresh mr-1"></i> 刷新';
                        refreshBtn.disabled = false;
                    }, 100);
                });
            };

            // 防抖函数
            function debounce(func, wait) {
                let timeout, indrtime;
                return function () {
                    const context = this;
                    const args = arguments;
                    clearTimeout(timeout);
                    clearTimeout(indrtime);
                    timeout = setTimeout(() => func.apply(context, args), wait);
                    indrtime = setTimeout(() => indicatorRow.style.display = 'table-row', wait - 100);
                };
            }

            // 初始化应用
            const initApp = () => {
                // updateTable();
                initSorting();
                initEventListeners();
                //
                indicatorRow.style.display = 'table-row';
                //
                setTimeout(() => {
                    clearAllFilters();

                }, 50);
            };

            // 启动应用
            document.addEventListener('DOMContentLoaded', initApp);

        </script>
    </body>

</html>
